Adding 
```rust
pub struct PublishMetadata {
    // ...
    #[serde(rename(serialize = "rust-version"))]
    pub rust_version: Option<String>,
 }
``` 
seems to fix. The `serde(rename(serialize()))` directive is required because the checking is done [by reserializing to JSON](https://github.com/kellnr/kellnr/blob/9612b253a5e2fdc36c13085cb4e190479a7ccab0/crates/registry/src/kellnr_api.rs#L390) and then checking if the fields are set. Maybe a cleaner solution is to carry a `vec` of all the TOML strings through from where they are initially parsed, so this does not need to be maintained? 

Thanks to all maintainers who contributed to a great project!

